import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import{BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import Homepage from './components/Homepage';
import AboutPage from './components/AboutPage'
import {TransitionGroup, CSSTransition} from "react-transition-group"
class App extends Component {
  constructor(props){
    super(props);
    this.state = {};
  }
  render(){
    const { locaiton } =this.props;

    const timeout = { enter: 800, exit:400};
  return (
    <Router>
    <div className="App"> 
      <header className="App-header">
        <TransitionGroup component = "div" className="pusher">
        <CSSTransition timeout={timeout} className="pageSlider" mounOnEnter={false} unmountOnExit={true}>
        <Switch location ={location}>
        <Route path='/' exact component={Homepage} />
        <Route path='/AboutPage' exact component={AboutPage} />
        </Switch>
        </CSSTransition>
        </TransitionGroup>
      </header>


      <footer>Created By ZHENGJIAN LIU</footer>
    </div>
    </Router>

  );
}
}
export default App;
